CREATE OR REPLACE VIEW test.acker AS 
 SELECT acker_daten.gid, acker_daten.id, acker_daten.fruchtart, acker_daten.landwirt, acker_daten.area, acker_daten.the_geom, acker_daten.create_date, acker_daten.archive_date, acker_daten.create_user, acker_daten.last_user, acker_daten.change_type, acker_daten.change_affected_columns
   FROM test.acker_daten
