CREATE OR REPLACE RULE _delete AS
    ON DELETE TO test.acker DO INSTEAD  DELETE FROM test.acker_daten
  WHERE acker_daten.gid = old.gid AND acker_daten.archive_date IS NULL;

CREATE OR REPLACE RULE _insert AS
    ON INSERT TO test.acker DO INSTEAD  INSERT INTO test.acker_daten (fruchtart, landwirt, area, the_geom) 
  VALUES (new.fruchtart, new.landwirt, new.area, new.the_geom);

CREATE OR REPLACE RULE _update AS
    ON UPDATE TO test.acker DO INSTEAD  UPDATE test.acker_daten SET fruchtart = new.fruchtart, landwirt = new.landwirt, area = new.area, the_geom = new.the_geom
  WHERE acker_daten.gid = new.gid;


